import styled from '@emotion/styled';

const Submit = styled('button')`
  border: 2px solid #000;
  background: none;
  font-size: 20px;
  padding: 10px;
  border-radius: 5px;
  text-transform: uppercase;
  cursor: pointer;
`;

export default Submit;
